DROP TABLE IF EXISTS "playlist_items";

CREATE TABLE playlist_items (playlist_id INTEGER NOT NULL, track_id INTEGER NOT NULL, pos INTEGER NOT NULL, FOREIGN KEY(playlist_id) REFERENCES playlists(playlist_id), FOREIGN KEY(track_id) REFERENCES tracks(track_id));

DROP TABLE IF EXISTS "playlists";

CREATE TABLE playlists (name TEXT, description , playlist_id INTEGER PRIMARY KEY, playlist_persistent_id TEXT, distinguished_kind , all_items , music , folder , parent_persistent_id , smart_info , smart_criteria );

DROP TABLE IF EXISTS "tracks";

CREATE TABLE tracks (track_id INTEGER PRIMARY KEY, name TEXT, artist TEXT, album_artist TEXT, composer TEXT, album TEXT, genre TEXT, kind TEXT, size INTEGER, total_time INTEGER, disc_number INTEGER, disc_count INTEGER, track_number INTEGER, track_count INTEGER, year INTEGER, date_modified TEXT, date_added TEXT, bit_rate INTEGER, sample_rate INTEGER, release_date , normalization INTEGER, sort_album , sort_album_artist , sort_artist , sort_name , persistent_id TEXT, track_type TEXT, protected , purchased , location TEXT, file_folder_count , library_folder_count , explicit , skip_count , skip_date , album_rating , album_rating_computed , play_count INTEGER, play_date INTEGER, play_date_utc TEXT, rating INTEGER, compilation INTEGER, comments TEXT, clean , artwork_count , has_video , hd , video_width , video_height , music_video , file_type TEXT, grouping , work , disabled INTEGER, start_time INTEGER, stop_time INTEGER, sort_composer , bpm INTEGER, volume_adjustment INTEGER, part_of_gapless_album , series );

DROP TABLE IF EXISTS "vox_albums";

CREATE TABLE "vox_albums" ("id" integer, "sentence" text, "album" text, "artist" text, PRIMARY KEY (id));

DROP TABLE IF EXISTS "vox_artists";

CREATE TABLE "vox_artists" ("id" integer, "sentence" text, "artist" text, PRIMARY KEY (id));

DROP TABLE IF EXISTS "vox_genres";

CREATE TABLE "vox_genres" ("id" integer, "sentence" text, "genre" text, PRIMARY KEY (id));

DROP TABLE IF EXISTS "vox_playlists";

CREATE TABLE "vox_playlists" ("id" integer, "sentence" text, "playlist_id" integer, PRIMARY KEY (id), FOREIGN KEY(playlist_id) REFERENCES playlists(playlist_id));

DROP TABLE IF EXISTS "vox_tracks";

CREATE TABLE "vox_tracks" ("id" integer, "sentence" text, "track_id" integer, PRIMARY KEY (id), FOREIGN KEY(track_id) REFERENCES tracks(track_id));








